pub enum EventOption {

    /// A key event
    Key(KeyEvent),

    /// A mouse event (absolute)
    Mouse(MouseEvent),

    /// A mouse event (relative)
    MouseRelative(MouseRelativeEvent),

    /// A mouse button event
    Button(ButtonEvent),

    /// A mouse scroll event
    Scroll(ScrollEvent),

    /// A quit request event
    Quit(QuitEvent),

    /// A focus event
    Focus(FocusEvent),

    /// A move event
    Move(MoveEvent),

    /// A resize event
    Resize(ResizeEvent),

    /// A screen report event
    Screen(ScreenEvent),

    /// A clipboard event
    Clipboard(ClipboardEvent),

    /// An unknown event
    Unknown(Event),

    /// No event
    None,
}
